export default function Todo({ id, text, status, getStatus }) {
  return (
    <article>
      <p>Id: {id}</p>
      <p>Todo: {text}</p>
      {/* <p>Status: {status}</p>
       */}
      {status === true ? <p>Complete</p> : <p>Not</p>}

      <button type="button" onClick={getStatus}>
        Complete
      </button>
      <button type="button">Delete</button>
    </article>
  )
}
